import React from 'react';
import '../navbar.css';
import {Button,} from "react-bootstrap";


function Btn(color,width,text){
    return(
        <Button 
        style={{
            width:width,
            backgroundColor: color,
        }}
        className='Btn'>{text} 
        </Button>
    )
}

export default Btn;
